import Footer from './components/Footer';
import MainContent from './components/MainContent';

class App extends Component {
  state = {
    todos: [
      {
        id : 1,
        title : 'Take Out the trash',
        completed : false,
      },
      {
        id : 2,
        title : 'Take Out the trash',
        completed : false,
      },
      {
        id : 3,
        title : 'Dinner at home',
        completed : false,
      },
      {
        id : 4,
        title : 'New Learning On React',
        completed : false,
      }
    ]
  }

  render() {

    return (
      <div>
        <Header/>
        <Header/>
        <Footer/>
      </div>
    );
  }
}

export default App;
